from sympy import binomial, factorial as f, floor
def T(n, k):
    return 0 if (n - k)%2 else 2**(1 - k)*sum([(-1)**((n + k)//2 - i)*binomial(k, i)*(2*i - k)**n for i in range(k//2 + 1)])//f(k)
